using System.Reflection;
using System.Text.Json;
using Core.Entities;
using Core.Entities.OrderAggregate;
using Microsoft.AspNetCore.Identity;

namespace Infrastructure.Data
{
    public class BarbershopContextSeed
    {
        public static async Task SeedAsync(BarbershopContext context, UserManager<AppUser> userManager,
            RoleManager<AppRole> roleManager)
        {
            var path = Path.GetDirectoryName(Assembly.GetExecutingAssembly().Location);

            if (!context.ProductBrands.Any())
            {
                var brandsData = File.ReadAllText(path + @"/Data/SeedData/brands.json");
                var brands = JsonSerializer.Deserialize<List<ProductBrand>>(brandsData);
                context.ProductBrands.AddRange(brands);
                if (context.ChangeTracker.HasChanges())
                {
                    await context.SaveChangesAsync();
                }
            }

            if (!context.ProductTypes.Any())
            {
                var typesData = File.ReadAllText(path + @"/Data/SeedData/types.json");
                var types = JsonSerializer.Deserialize<List<ProductType>>(typesData);
                context.ProductTypes.AddRange(types);
                if (context.ChangeTracker.HasChanges())
                {
                    await context.SaveChangesAsync();
                }
            }

            if (!context.Products.Any())
            {
                var productsData = File.ReadAllText(path + @"/Data/SeedData/products.json");
                var products = JsonSerializer.Deserialize<List<Product>>(productsData);
                context.Products.AddRange(products);
                if (context.ChangeTracker.HasChanges())
                {
                    await context.SaveChangesAsync();
                }
            }

            if (!context.DeliveryMethods.Any())
            {
                var deliveryData = File.ReadAllText(path + @"/Data/SeedData/delivery.json");
                var methods = JsonSerializer.Deserialize<List<DeliveryMethod>>(deliveryData);
                context.DeliveryMethods.AddRange(methods);
                if (context.ChangeTracker.HasChanges())
                {
                    await context.SaveChangesAsync();
                }
            }

            if (!context.Services.Any())
            {
                var servicesData = File.ReadAllText(path + @"/Data/SeedData/services.json");
                var services = JsonSerializer.Deserialize<List<Service>>(servicesData);
                context.Services.AddRange(services);
                if (context.ChangeTracker.HasChanges())
                {
                    await context.SaveChangesAsync();
                }
            }

            if (!context.Addresses.Any())
            {
                var addressesData = File.ReadAllText(path + @"/Data/SeedData/addresses.json");
                var addresses = JsonSerializer.Deserialize<List<Address>>(addressesData);
                context.Addresses.AddRange(addresses);
                if (context.ChangeTracker.HasChanges())
                {
                    await context.SaveChangesAsync();
                }
            }

            // Users seed

            if (!userManager.Users.Any())
            {
                var users = new List<AppUser>
                {
                    new AppUser
                    {
                        FirstName = "User",
                        LastName = "User",
                        Email = "user@test.com",
                        PhoneNumber = "061 111 111",
                        UserName = "mobile",
                        Address = new Address
                        {
                            FirstName = "First name user",
                            LastName = "Last name user",
                            Street = "Sjeverni logor bb",
                            City = "Mostar",
                            State = "BiH",
                            ZipCode = "88000"
                        },
                        Photo = "",
                    },
                     new AppUser
                    {
                        FirstName = "Barber1",
                        LastName = "Barber1",
                        Email= "barber1@test.com",
                        PhoneNumber = "061 222 222",
                        UserName = "barber1",
                        Photo = ""
                        },
                        new AppUser
                    {
                        FirstName = "Barber2",
                        LastName = "Barber2",
                        Email= "barber2@test.com",
                        PhoneNumber = "061 333 333",
                        UserName = "barber2",
                        Photo = ""
                    },
                    new AppUser
                    {
                        FirstName = "Admin",
                        LastName = "Admin",
                        Email= "admin@test.com",
                        PhoneNumber = "061 444 444",
                        UserName = "desktop",
                        Photo = ""
                    }
                };

                var roles = new List<AppRole>
                {
                    new AppRole{ Name = "Client"},
                    new AppRole{ Name = "Barber"},
                    new AppRole{ Name= "Admin"}
                };

                foreach (var role in roles)
                {
                    await roleManager.CreateAsync(role);
                };

                foreach (var user in users)
                {
                    await userManager.CreateAsync(user, "test");
                    if (user.UserName == "mobile") await userManager.AddToRoleAsync(user, "Client");
                    if (user.UserName == "barber1" || user.UserName == "barber2") await userManager.AddToRoleAsync(user, "Barber");
                    if (user.UserName == "desktop") await userManager.AddToRoleAsync(user, "Admin");
                }
                if (context.ChangeTracker.HasChanges())
                {
                    await context.SaveChangesAsync();
                }
            }

            if (!context.Reviews.Any())
            {
                var reviewsData = File.ReadAllText(path + @"/Data/SeedData/reviews.json");
                var reviews = JsonSerializer.Deserialize<List<Review>>(reviewsData);
                context.Reviews.AddRange(reviews);
                if (context.ChangeTracker.HasChanges())
                {
                    await context.SaveChangesAsync();
                }
            }

            if (!context.News.Any())
            {
                var newsData = File.ReadAllText(path + @"/Data/SeedData/news.json");
                var news = JsonSerializer.Deserialize<List<News>>(newsData);
                context.News.AddRange(news);
                if (context.ChangeTracker.HasChanges())
                {
                    await context.SaveChangesAsync();
                }
            }

            if (!context.Orders.Any())
            {
                var ordersData = File.ReadAllText(path + @"/Data/SeedData/orders.json");
                var orders = JsonSerializer.Deserialize<List<Order>>(ordersData);
                orders.Find(o => o.PaymentIntentId == "payment_intent_1").Status = OrderStatus.Completed;
                orders.Find(o => o.PaymentIntentId == "payment_intent_2").Status = OrderStatus.Completed;
                orders.Find(o => o.PaymentIntentId == "payment_intent_3").Status = OrderStatus.Completed;
                orders.Find(o => o.PaymentIntentId == "payment_intent_4").Status = OrderStatus.Completed;
                orders.Find(o => o.PaymentIntentId == "payment_intent_5").Status = OrderStatus.Completed;
                orders.Find(o => o.PaymentIntentId == "payment_intent_6").Status = OrderStatus.Completed;
                orders.Find(o => o.PaymentIntentId == "payment_intent_7").Status = OrderStatus.PaymentReceived;
                orders.Find(o => o.PaymentIntentId == "payment_intent_8").Status = OrderStatus.PaymentReceived;
                orders.Find(o => o.PaymentIntentId == "payment_intent_9").Status = OrderStatus.PaymentReceived;
                orders.Find(o => o.PaymentIntentId == "payment_intent_10").Status = OrderStatus.PaymentFailed;

                context.Orders.AddRange(orders);
                if (context.ChangeTracker.HasChanges())
                {
                    await context.SaveChangesAsync();
                }
            }

            if (!context.Terms.Any())
            {
                var termsData = File.ReadAllText(path + @"/Data/SeedData/terms.json");
                var terms = JsonSerializer.Deserialize<List<Term>>(termsData);
                context.Terms.AddRange(terms);
                if (context.ChangeTracker.HasChanges())
                {
                    await context.SaveChangesAsync();
                }
            }

            if (!context.Appointments.Any())
            {
                var appointmentsData = File.ReadAllText(path + @"/Data/SeedData/appointments.json");
                var appointments = JsonSerializer.Deserialize<List<Appointment>>(appointmentsData);
                context.Appointments.AddRange(appointments);
                if (context.ChangeTracker.HasChanges())
                {
                    await context.SaveChangesAsync();
                }
            }

             if (!context.Pasosi.Any())
            {
                var pasosiData = File.ReadAllText(path + @"/Data/SeedData/pasosi.json");
                var pasosi = JsonSerializer.Deserialize<List<FITPasos>>(pasosiData);
                context.Pasosi.AddRange(pasosi);
                if (context.ChangeTracker.HasChanges())
                {
                    await context.SaveChangesAsync();
                }
            }



        }
    }
}